        "# feols clusters by the first\n",
        "# fixed effect by default, no adjustment necessary\n",
        "clfe <- feols(Rate ~ Treated | State + Quarter,\n",
        "           data = od)\n",
        "results <- msummary(clfe, stars = c('*' = .1, '**' = .05, '***' = .01))\n",
        "display_html(toString(results))"
      ]
