        "quarter_factor <- factor(od$Quarter, levels = c(\"Q12011\", \"Q22011\", \"Q32011\"))\n",
        "\n",
        "ggplot(od, aes(x = quarter_factor, y = Rate, color = FakeTreat2)) +\n",
        "  geom_point() +\n",
        "  geom_smooth(method = \"lm\") +\n",
        "  geom_vline(xintercept = 3, linetype = \"dashed\") +\n",
        "  scale_color_manual(values = c(\"#0000FF\", \"#FF0000\")) +\n",
        "  labs(title = \"State Quarter Rate\", x = \"Quarter\", y = \"Rate\", color = \"FakeTreat2\")\n",
        "print(p)"
